        </div>
        <div className="fdown2">
          <div id="fp">
            <div id="ifp" style={{ width: `${fsc2 * 2}%` }}></div>
          </div>
          <h4 id="fpn">{fsc2}/50</h4>
          {jsbn2 === false ? (
            <button className="bjoin" onClick={fsolo2}>
              JOIN
            </button>
